import React from 'react';
import { FaHome, FaUser, FaProjectDiagram, FaFileAlt, FaEnvelope } from 'react-icons/fa';

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center px-6 py-4 text-white bg-teal border-b border-gold">
      <h1 className="text-2xl font-serif text-gold">My Portfolio</h1>
      <ul className="flex gap-6 font-sans">
        <li><a href="#home" className="text-gold hover:text-white"><FaHome /> Home</a></li>
        <li><a href="#about" className="text-gold hover:text-white"><FaUser /> About</a></li>
        <li><a href="#projects" className="text-gold hover:text-white"><FaProjectDiagram /> Projects</a></li>
        <li><a href="#resume" className="text-gold hover:text-white"><FaFileAlt /> Resume</a></li>
        <li><a href="#contact" className="text-gold hover:text-white"><FaEnvelope /> Contact</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
